    operators = set(['+', '-', '*', '/'])
    for token in postfix.split(' '):
        if token not in operators:
            stack.append(token)
        else:
            operand2 = stack.pop()
            operand1 = stack.pop()
            stack.append('(' + operand1 + ' ' + token + ' ' + operand2 + ')')
